import React, { useState } from 'react';
import * as icons from 'react-icons/fa';
import { Link } from 'react-router-dom';
import './Navbar.css'

function Navbar() {
    const [click, setClick] = useState(false);
    const Logout = () => {
        window.localStorage.removeItem("cUser");
        window.location.href = "/";
    }
    const OpenMenu = () => {
        setClick(!click);
    }
    return (
        <>
            <nav className='navbar'>
                <div className='menu-icon'>
                    {click ? <icons.FaTimes onClick={OpenMenu} /> : <icons.FaBars onClick={OpenMenu} />}
                </div>
                <ul className={click ? 'nav-menu active' : 'nav-menu'}>
                    <li className='nav-item'>
                        <Link to='/' className='nav-links' > Home </Link>
                    </li>
                    <li className='nav-item'>
                        <Link to='/ManageUsers' className='nav-links' > ManageUsers </Link>
                    </li>
                    <li className='nav-item'>
                        <Link to='/Contact' className='nav-links' > Contact Us  </Link>
                    </li>
                    <li className='nav-item' >
                        <Link to='#' className='nav-links' ></Link>
                    </li>
                    <li className='nav-item'><Link className='nav-links' to="/#" onClick={Logout}>Logout <icons.FaSignOutAlt /></Link></li>
                </ul>
            </nav>
        </>
    );
}

export default Navbar;
